  input: TEXT,F3XA,,"On all direct solicitation materials, the WVSDEC includes the
    statement 'Federal law requires politcal committees to report the name, mailing
    address, occupation and name of employer for each individual whose contributions
    aggregate in excess of $200 in a calendar year' along with a form to complete
    the said information and a self addressed envelope.  The WVSDEC has procedures
    to obtain any missing information.  If the WVSDEC is unable to phone the contributor,
    or find certain information through internet services, the WVSDEC will, within
    30 days, send a direct mailing, including a self addressed envelope, requesting
    the contributor's full name, mailing address, occupation and employer.  A statement
    informing the contributor of the federal law is included in this request.  The
    WVSDEC maintains records of all initial and follow up requests.  The contributions
    received from WVEA PAC ($5,000 on 9/1/04), the Mid Atlantic Regional Council of
    Carpenter ($1,000 on 9/1/04), the  Mid Atlantic Regional Council of Carpenter
    ($1,000 on 9/1/04), and the Bob Wise for Governor Committee ($15,000 on 8/4/04)
    were deposited into the federal account in error.  These funds are being transfered
    to the non-federal account.  A copy of the check will be provided by US Mail."
